script: |
  super -f text -I q11513.spq | sort > q11513.out

inputs:
  - name: q11513.spq
    data: |
      SELECT DISTINCT 45 * col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE 65 NOT BETWEEN + col0 * col2 * - 41 + + ( - col0 ) + + 83 / + col1 AND - - col2 + 41 * + col1;
  - name: tab1

outputs:
  - name: q11513.out
    data: |
